Array.prototype.slice.call(document.querySelectorAll('.weapon')).map(function(elm){
    var name = elm.querySelector('.weapon-name').innerHTML;
    var cost = parseInt(elm.querySelector('.weapon-cost-inner').innerHTML.split(",").join(""));
    var value = parseFloat(elm.querySelector('.weapon-sps').innerHTML.split(",").join(""));
    return {name: name, worth: value / cost};
}).sort(function(w1, w2){
    return w1.worth < w2.worth;
}).map(function(weapon){
    return weapon.name + ": " + parseInt(1 / weapon.worth);
});
